import React from 'react';
import styles from './Projects.module.css';

const Projects = () => {
  const projects = [
    {
      id: 1,
      title: 'Upper Marsyangdi Hydro',
      year: 'Completed 2023',
      image: 'https://images.unsplash.com/photo-1512453475868-bada1adc6f04?w=800&h=300&fit=crop'
    },
    {
      id: 2,
      title: 'Mustang Solar Hub',
      year: 'Completed 2022',
      image: 'https://images.unsplash.com/photo-1497440871351-208b0584908f?w=800&h=300&fit=crop'
    },
    {
      id: 3,
      title: 'Koshi Bridge',
      year: 'Completed 2021',
      image: 'https://images.unsplash.com/photo-1581092918056-0c4c3acd3789?w=800&h=300&fit=crop'
    }
  ];

  return (
    <section id="projects" className={styles.projects}>
      <div className={styles.container}>
        <div className={styles.sectionHeader}>
          <h2>Completed Projects</h2>
          <div className={styles.line}></div>
        </div>
        <div className={styles.projectsGrid}>
          {projects.map(project => (
            <div key={project.id} className={styles.projectItem}>
              <img src={project.image} alt={project.title} />
              <div className={styles.projectOverlay}>
                <h4>{project.title}</h4>
                <p>{project.year}</p>
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Projects;
